feature-styles:
  - name: name
    rules:
      - symbolizers:
          - line:
              stroke-color: "#000000"
              stroke-width: 2
          - line:
              stroke-color: "#000000"
              stroke-width: 5
              stroke-dasharray: "1.51 1.89 1.51 1.89 1.51 30.37"
